/* skadi/js/schema/schema.js */

var skadi = skadi || {};

skadi.SchemaError = class extends Error {

    constructor(message) {
        super(message)
        this.name = "SkadiSchemaError";
    }

}


skadi.Schema = class {

    constructor() {
        this.package_types = {};
        this.node_types = {};
        this.link_types = {};
        this.rl = new skadi.ResourceLoader();
    }

    async loadPackage(url,obj) {
        let id = obj["id"];

        if (id in this.package_types) { // this package already loaded?
            return;
        }

        let executor = obj["executor"]
        if (executor != "javascript") {
            throw new skadi.SchemaError("Invalid value for schema executor: found \""+executor+"\", expecting \"javascript\"");
        }

        let package_type = new skadi.PackageType(id, url, obj);
        await package_type.load_l10n("");
        this.package_types[package_type.get_id()] = package_type;


        let resources = [];

        if (obj["dependencies"]) {
            obj["dependencies"].forEach(item => resources.push(package_type.get_resource_url(item)));
        }

        if (obj.node_types) {
            for(let nt_id in obj.node_types) {
                let nt = obj.node_types[nt_id];
                if (nt["dependencies"]) {
                    nt["dependencies"].forEach(item => resources.push(package_type.get_resource_url(item)));
                }
            }
        }

        /* load resources defined in the package */

        let load_results = await this.rl.load_resources(resources);
        let failed_resources = [];
        for(let resource_name in load_results) {
            if (!load_results[resource_name]) {
                failed_resources.push(resource_name)
            }
        }

        /* raise an error if any resources failed to load */

        if (failed_resources.length > 0) {
            throw new skadi.SchemaError("Unable to load package resources: "+JSON.stringify(failed_resources))
        }

        let node_types = obj["node_types"];
        for(let node_id in node_types) {
            let nt = node_types[node_id];
            let node_type = new skadi.NodeType(node_id, package_type, nt);
            if (node_type.is_enabled()) {
                this.node_types[node_type.get_id()] = node_type;
            }
        }

        let link_types = obj["link_types"];
        for(let link_id in link_types) {
            let lt = link_types[link_id];
            let link_type = new skadi.LinkType(link_id, package_type, lt);
            this.link_types[link_type.get_id()] = link_type;
        }

        return package_type;
    }

    get_resource_url(package_id, relative_path) {
       return this.package_types[package_id].get_resource_url(relative_path);
    }

    get_node_type(id) {
        return this.node_types[id];
    }

    get_link_type(id) {
        return this.link_types[id];
    }

    get_link_colour(id) {
        if (id in this.link_types) {
            return this.link_types[id].get_colour();
        }
        return "grey";
    }

    get_package_type(id) {
        return this.package_types[id];
    }

    get_package_types() {
        let ids = [];
        for (let key in this.package_types) {
            ids.push(key);
        }
        return ids;
    }

    get_packages_list() {
        let result = [];
        for (let key in this.package_types) {
            let pt = this.package_types[key];
            result.push({"id":pt.get_id(),"metadata":pt.get_metadata()});
        }
        return result;
    }

    get_node_types() {
        let ids = [];
        for (let key in this.node_types) {
            ids.push(key);
        }
        return ids;
    }
}



/* skadi/js/app/application.js */

var skadi = skadi || {};

skadi.application_statuses = {};
skadi.application_status_areas = {};

skadi.Application = class extends skadi.Core {

    constructor(l10n_utils, schema, element_id, node_factory, configuration_factory) {
        super(l10n_utils, schema, element_id, null, node_factory, configuration_factory);
    }

    open_display() {
        let configuration_list = this.network.get_configuration_list();
        configuration_list.map(package_id => {
            let configuration = this.get_network().get_configuration(package_id);
            this.embed_configuration(package_id,configuration);
        });
        let node_list = this.get_network().get_node_list();
        node_list.map(node_id => {
            let node = this.get_network().get_node(node_id);
            this.embed_node(node_id,node);
        });
    }

    embed_configuration(package_id,configuration) {
        let l10n_utils = configuration.get_package_type().get_l10n_utils();

        let li = this.div.append("div").attr("class","exo-tree").attr("role","tree")
            .append("ul").append("li").attr("role","treeitem");
        let input = li.append("input").attr("type","checkbox").attr("aria-hidden","true");
        let label = li.append("label").text(configuration.get_package_type().get_metadata().name);
        
        skadi.application_status_areas[package_id] = label.append("span");
        skadi.application_status_areas[package_id].attr("class","status_label");
        
        let div = li.append("div");

        if (l10n_utils) {
            let select_elt = l10n_utils.create_language_select();
            div.node().appendChild(select_elt);   
        }

        let url = configuration.get_url();
        if (url) {
            let content_div = div.append("div");
            input.node().addEventListener("change",this.create_configuration_openclose_callback(content_div,configuration));
        }

        if (!url && !l10n_utils) {
            input.attr("disabled","disabled");
        }        

        this.div.append("hr");
        if (package_id in skadi.application_statuses) {
            let status = skadi.application_statuses[package_id];
            this.update_status_area(package_id, status.state, status.status_message);
        }
    }

    embed_node(node_id,node) {
        let li = this.div.append("div").attr("class","exo-tree").attr("role","tree")
            .append("ul").append("li").attr("role","treeitem");
        let input = li.append("input").attr("type","checkbox").attr("aria-hidden","true");
        let label = li.append("label").text(node.get_metadata().name);
        let div = li.append("div");

        let url = node.get_type().get_html_url();
        if (url) {
            input.node().addEventListener("change",this.create_node_openclose_callback(div,node));
        }

        skadi.application_status_areas[node_id] = label.append("span");
        skadi.application_status_areas[node_id].attr("class","status_label");
        
        this.div.append("hr");
        if (node_id in skadi.application_statuses) {
            let status = skadi.application_statuses[node_id];
            this.update_status_area(node_id, status.state, status.status_message);
        }
    }

    create_configuration_openclose_callback(div,configuration) {
        return (evt) => {
            if (evt.target.checked) {
                // open the configuration in an iframe
                let url = configuration.get_url();
                let iframe = div.append("iframe").attr("class", "skadi_iframe")
                    .attr("src", url).attr("width", "100%").attr("height","500px").attr("target","_new").node();
                iframe.addEventListener("load", (ev) => {
                    configuration.get_wrapper().open(iframe.contentWindow,null,null);
                });
            } else {
                // close the configuration
                configuration.get_wrapper().close();
                div.html("");
            }
        }
    }


    create_node_openclose_callback(div,node) {
        return (evt) => {
            if (evt.target.checked) {
                // open the node in an iframe
                let url = node.get_type().get_html_url();
                let iframe = div.append("iframe").attr("class", "skadi_iframe")
                    .attr("src", url).attr("width", "100%").attr("height","500px").attr("target","_new").node();
                iframe.addEventListener("load", (ev) => {
                    node.get_wrapper().open(iframe.contentWindow,null,null);
                });
            } else {
                // close the node
                node.get_wrapper().close();
                div.html("");
            }
        }
    }

    update_node_status(id, state, status_message) {
        skadi.application_statuses[id] = { "state":state, "status_message":status_message };
        this.update_status_area(id, state, status_message);
        super.update_node_status(id, state, status_message);
    }

    update_configuration_status(id, state, status_message) {
        skadi.application_statuses[id] = { "state":state, "status_message":status_message };
        this.update_status_area(id, state, status_message);
        super.update_configuration_status(id, state, status_message);
    }

    update_status_area(id, state, status_message) {
        if (id in skadi.application_status_areas) {
            let area = skadi.application_status_areas[id];
            area.node().innerHTML = "";
            area.text(status_message);
            let status_icon = skadi.create_icon_for_status_state(state);
            if (status_icon) {
                area.node().appendChild(status_icon);
            }
        }
    }

}

/* skadi/js/skadi-api.js */

var skadi = skadi || {};

skadi.Api = class {

    constructor() {
        this.schema = null;
        this.instance = null; // designer or application
    }

    async load_l10n(l10n_base_url) {
        this.l10n_utils = new skadi.L10NUtils("api", l10n_base_url);
        await this.l10n_utils.initialise();
    }

    set_instance(designer_or_application) {
        this.instance = designer_or_application;
    }

    /**
     * Load schemas into skadi
     *
     * @param {Array} package_urls - an array of urls pointing to schema files
     */
    async load_schema(package_urls) {
        async function loadPackageFromUrl(url,schema) {
            return await fetch(url)
                .then(response => response.json())
                .then(schema_config => schema.loadPackage(url, schema_config));
        }

        this.schema = new skadi.Schema();
        let packages = [];
        for (let idx = 0; idx < package_urls.length; idx++) {
            packages.push(await loadPackageFromUrl(package_urls[idx],this.schema));
        }
        return packages;
    }

    init() {
        // load up configurations for any packages that specify them
        for(let package_id in this.schema.package_types) {
            let package_type = this.schema.package_types[package_id];
            if (package_type.get_configuration_classname()) {
                let conf = this.create_configuration(package_type);
                conf.create_instance();
                this.instance.add_configuration(conf);
            }
        }
    }

    create_configuration(package_type) {
        return new skadi.CoreConfiguration(this.instance,package_type,{});
    }

    load(from_obj, supress_events) {
        this.instance.clear(supress_events);
        this.instance.deserialise(from_obj ,supress_events);
    }

    get_schema() {
        return this.schema;
    }

    get_l10n_utils() {
        return this.l10n_utils;
    }

    get_network() {
        return this.instance.get_network();
    }

    set_status(node_id, status_msg, state) {
        this.instance.update_node_status(node_id, state, status_msg);
    }

    set_configuration_status(package_id, status_msg, state) {
        this.instance.update_configuration_status(package_id, state, status_msg);
    }

    update_execution_state(node_id, state) {
        this.instance.update_execution_state(node_id, state);
    }

    execution_complete() {
        this.instance.execution_complete();
    }

    get_version() {
        return "${SKADI-VERSION}"; // placeholder substituted with actual version by the build.py script
    }

    async handle_load_topology_from() {
        let url_params = new URLSearchParams(window.location.search);
        // check for a topology to load
        let topology_url = url_params.get("load_topology_from");
        if (topology_url) {
            let topology_origin = new URL(topology_url,window.location).origin;
            if (topology_origin != window.location.origin) {
                console.error("unable to load topology from different origin:"+topology_origin);
            } else {
                await fetch(topology_url).then(r => r.text()).then(txt => {
                    try {
                        let obj = JSON.parse(txt);
                        this.load(obj);
                    } catch (ex) {
                        console.error("load_topology_from failed:" + ex);
                    }
                });
            }
        }
    }
}

